import React from 'react'
import PropTypes from 'prop-types'

export default function Scorecard(players) {
	return <div>
		<h1> Scorecard </h1>
		<h2> {players.id} </h2>
	</div>
}

Scorecard.propTypes = {
	players: PropTypes.arrayOf(PropTypes.number).isRequired 
}
